Rtot = 7
Ndiv = 8 # base square has edge 1/Ndiv
Nrge = 8 # 0 <= x,y < Nrge
Nax  = Nrge * Ndiv

def neighbors(j, i, kP, Rows):
    rows = Rows[kP]
    result = []
    nj = len(rows)
    assert(j%2 == nj%2)
    assert(i%2 == rows[0]%2)
    j0 = j//2
    for jj in range(nj):
        jcorner = j0 + jj - nj//2
        if jcorner<0 or jcorner>=Nax:
            continue
        ni = rows[jj]
        i0 = i//2
        for ii in range(ni):
            icorner = i0 + ii - ni//2
            if icorner<0 or icorner>=Nax:
                continue
            result.append((jcorner, icorner))
    # print("neighbors(%3i %3i) kP=%3i nj=%3i %s -> %s (size %i)" % (j, i, kP, nj, str(rows), str(result), len(result)))
    return result

def unclaimed(F):
    result = 0
    for row in F:
        for val in row:
            if val == -2:
                result += 1
    return result

def arrange_polyominoes():
    fut.print_provenience()

    # set up field of base squares
    F = [[-2 for i in range(Nax)] for j in range(Nax)]
    count = 0
    for j in range(Nax):
        for i in range(Nax):
            if j**2+i**2 > (Rtot*Ndiv)**2:
                F[j][i] = -1
                count += 1

    # load convergence radius indices
    RadialIndex = []
    for j in range(Nax*2):
        row = []
        for i in range(Nax*2):
            line = RadialData[Nax*2*j + i]
            assert(j == line[0])
            assert(i == line[1])
            row.append(line[3])
        RadialIndex.append(row)

    # make lists of squared diameters and row patterns
    P = ep.sorted_polyominoes(40)
    Rows = []
    for i, j, d2, area, rows in P:
        Rows.append(rows)
    # print("# Number of available polyominoes: %3i" % len(Rows))

    Centers = []
    while unclaimed(F)>0:
        max_improve = 0
        i_max, j_max = -1, -1
        for j in range(2*Nax):
            for i in range(2*Nax):
                kP = RadialIndex[j][i]
                Neighbors = neighbors(j, i, kP, Rows)
                count_improve = 0
                for jj, ii in Neighbors:
                    if F[jj][ii] == -2:
                        count_improve += 1
                if count_improve > max_improve:
                    max_improve = count_improve
                    j_max = j
                    i_max = i

        kP = RadialIndex[j_max][i_max]
        Neighbors = neighbors(j_max, i_max, kP, Rows)
        for jj, ii in Neighbors:
            if F[jj][ii] == -2:
                F[jj][ii] = len(Centers)
        Centers.append((i_max,j_max))
        print("# Improve by %3i Place %3i at %3i %3i, kP=%3i neighbors #=%3i" %
              (max_improve, len(Centers), j_max, i_max, RadialIndex[j][i], len(Neighbors)))

    print("# coord -> tile")
    for j in range(Nax):
        for i in range(Nax):
            print("%i," % F[j][i], end="")
        print()
    print("# tiles")
    for c in Centers:
        print("%3i, %3i," % c)

    print("# Taylor coefficients")
    fut.print_begin_autogenerated()
    print("alignas(64) static const double TaylorCoeffs[%i] = {" % (2*24*len(Centers)))
    for c in Centers:
        x = c[0]/(2*Ndiv)
        y = c[1]/(2*Ndiv)
        z = mpc(x, y)
        W = hp.wofz_taylor(z, 24)
        for w in W:
            print(" %s, %s," % (fut.double2hexstring(w.real), fut.double2hexstring(w.imag)), end="")
        print(" // x=%8g y=%8g" % (x, y))
    print("};")
    fut.print_end_autogenerated()

if __name__ == '__main__':
    arrange_polyominoes()
